import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class VesPassDataService {
  passedData: BehaviorSubject<any> = new BehaviorSubject<any>([]);

  constructor() {
    //
  }

  storeIds(data: string[]): void {
    this.passedData.next(data);
  }

  retrieveIds(): BehaviorSubject<any> {
    return this.passedData;
  }
}
